import React from "react";
import componentStyle from "./index.module.css";

export default class CoreType extends React.Component {
  render() {
    return (
      <div className={componentStyle["container"]}>
        <div className={componentStyle["font"]}>
          <div
            style={{
              backgroundImage: `
              linear-gradient(to right bottom,rgba(1, 157, 235, 0.5),rgba(62, 190, 226, 0.5)),
              url('react-app/src/component/FirstPage/img/single_core.jpeg')
            `,
            }}
          ></div>
          <div>{this.props.type}</div>
        </div>
        <div className={componentStyle["back"]}></div>
      </div>
    );
  }
}
